<!DOCTYPE html>
<html lang="en">

<head>
	<meta charset="utf-8">
	<meta name="viewport" content="width=device-width,initial-scale=1,minimum-scale=1,maximum-scale=1">
	<title>Log in/Sign up</title>
	<link rel="preconnect" href="https://fonts.googleapis.com">
	<link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
	<link href="https://fonts.googleapis.com/css2?family=Roboto:wght@300;400;500;700&display=swap" rel="stylesheet">
	<link rel="stylesheet" href="assets/css/style.css">
</head>

<body>
	<div class="ss-site-wrapper">
		<header class="ss-site-header ss-navbar">
			<ul class="ss-navbar__nav ss-navbar--right">
				<li class="ss-navbar__item">
					<button type="button" data-modal-target="ss-modal" class="btn btn-secondary">Log in</button>
				</li>
				<li class="ss-navbar__item">
					<button type="button" data-modal-target="ss-modal" class="btn btn-primary">Sign up</button>
				</li>
			</ul>
		</header> <!-- /.site-header -->

		<main class="ss-site-content">
			<section id="ss-modal" class="ss-modal">
				<div class="ss-modal__inner">
					<span class="ss-modal__close"><svg width="16" height="16" viewBox="0 0 16 16" fill="none" xmlns="http://www.w3.org/2000/svg">
							<path fill-rule="evenodd" clip-rule="evenodd" d="M4.818 4.05a.75.75 0 0 0-1.06 1.06l3.181 3.183-3.182 3.182a.75.75 0 1 0 1.061 1.06L8 9.355l3.182 3.182a.75.75 0 1 0 1.06-1.061L9.062 8.293l3.182-3.182a.75.75 0 0 0-1.061-1.06L8 7.231 4.818 4.05Z" fill="currentColor"></path>
						</svg></span>
					<div class="ss-modal__container">
						<div class="ss-modal__row">
							<div id="ssModalContent" class="ss-modal__content-block">
								<div class="ss-inner" id="ssModalContentFirst">
									<h2>Log in or sign up in seconds</h2>
									<p>Use your email or another service to continue with Canva (it's free)!</p>
									<div class="ss-btn-group">
										<div class="ss-btn-group__item">
											<a href="#" class="btn btn-secondary btn-block btn-icon btn-icon-google">Continue with Google</a>
										</div>
										<div class="ss-btn-group__item">
											<a href="#" class="btn btn-secondary btn-block btn-icon btn-icon-facebook">Continue with Facebook</a>
										</div>
										<div class="ss-btn-group__item">
											<a href="#" class="btn btn-primary btn-block">Continue with email</a>
										</div>
										<div class="ss-btn-group__item">
											<button type="button" id="continueAnotherWay" targetShow="ssModalContentSecond" class="btn btn-transparent btn-block">Continue another way</button>
										</div>
										<span class="ss-legal">By continuing, you agree to Canva's <a href="#">Terms of Use.</a>
											Read our <a href="#">Privacy Policy.</a></span>
										<button type="button" id="signUpemail" class="btn btn-link btn-block text-left"><svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
												<path fill-rule="evenodd" clip-rule="evenodd" d="M4 18.5a.5.5 0 0 1-.5-.5V5a.5.5 0 0 1 .5-.5h6.5c.275 0 .5.225.5.5v13.5H4Zm8.5 1.497V20H4a2 2 0 0 1-2-2V5a2 2 0 0 1 2-2h6.5c1.102 0 2 .895 2 2v3.997h2L20 9c1.105 0 2 .892 2 2v7l-1.5-.001V11c0-.278-.222-.5-.5-.5l-3.126-.001-4.374-.002v8l7.5.003a.5.5 0 0 0 .5-.5H22a2 2 0 0 1-2 2l-7.5-.003ZM5 7.497h4.5v-1.5H5v1.5Zm0 3h4.5v-1.5H5v1.5Zm4.5 3H5v-1.5h4.5v1.5Zm-4.5 3h4.5v-1.5H5v1.5Zm11-3h-2v-1.5h2v1.5Zm0 3h-2v-1.5h2v1.5Zm3-3h-2v-1.5h2v1.5Zm0 3h-2v-1.5h2v1.5Z" fill="currentColor"></path>
											</svg> Sign up with your work email</button>
									</div>
								</div>
								<div class="ss-inner" id="ssModalContentSecond">
									<h2>Continue to Canva</h2>
									<div class="ss-btn-group">
										<div class="ss-btn-group__item">
											<a href="#" class="btn btn-secondary btn-block btn-icon btn-icon-apple">Continue with apple</a>
										</div>
										<div class="ss-btn-group__item">
											<a href="#" class="btn btn-secondary btn-block btn-icon btn-icon-google">Continue with Google</a>
										</div>
										<div class="ss-btn-group__item">
											<a href="#" class="btn btn-secondary btn-block btn-icon btn-icon-facebook">Continue with Facebook</a>
										</div>
										<div class="ss-btn-group__item">
											<a href="#" class="btn btn-secondary btn-block btn-icon btn-icon-microsoft">Continue with Microsoft</a>
										</div>
										<div class="ss-btn-group__item">
											<a href="#" class="btn btn-secondary btn-block btn-icon btn-icon-clever">Continue with Clever</a>
										</div>
										<div class="ss-btn-group__item">
											<a href="#" class="btn btn-primary btn-block">Continue with email</a>
										</div>
										<div class="ss-btn-group__item">
											<a href="#" class="btn btn-secondary btn-block">Log in with mobile</a>
										</div>
										<div class="ss-btn-group__item">
											<button id="ssBackModalContent" class="btn btn-secondary btn-block" targetShow="ssModalContentFirst">Back</button>
										</div>
									</div>
								</div>
								<div class="ss-inner" id="ssModalContentThird">
									<h2>Continue with email</h2>
									<form class="ss-form">
										<div class="ss-form__header">
											<p>User your work email to sign up or log in.</p>
										</div> <!-- /.ss-form__header -->
										<div class="ss-form__section">
											<div class="ss-form__group">
												<label for="#" class="ss-form__label">Email</label>
												<input class="ss-form__control" type="email" placeholder="julie@example.com">
											</div>
										</div> <!-- /.ss-form-__ection -->
										<div class="ss-form__footer">
											<button type="submit" class="btn btn-primary btn-block">Continue</button>
										</div> <!-- /.ss-form__footer -->
									</form>
									<div class="ss-btn-group">
										<div class="ss-btn-group__item">
											<button id="ssBackModalContent2" class="btn btn-secondary btn-block" targetShow="ssModalContentFirst">Back</button>
										</div>
									</div>
								</div>
							</div>
							<div class="ss-modal__img-block">
								<picture class="ss-modal__img-cover">
									<source srcset="assets/images/ss-modal-cover.webp" type="image/webp">
									<source srcset="assets/images/ss-modal-cover.jpg" type="image/jpg">
									<img src="assets/image/ss-modal-cover.jpg" alt="Modal Cover" width="384" height="592" loading="lazy">
								</picture>
							</div>
						</div>
					</div>
				</div>
			</section> <!-- /.modal -->

